- cmd: wait
  for: "setenv loadkernel 'tftp \\$\\{kernel_addr_r\\} (?P<tftp_vmlinux>[\\w_/-]+Image)'"
  prompt: "VExpress64# "
  delay: 0
  jitter: 0.0005

- cmd: wait
  for: "setenv loadinitrd 'tftp \\$\\{initrd_addr_r\\} (?P<tftp_ramdisk>[\\w_/-]+ramdisk.img)"
  prompt: "VExpress64# "
  delay: 0
  jitter: 0.0005

- cmd: wait
  for: "setenv loadfdt 'tftp \\$\\{fdt_addr_r\\} (?P<tftp_dtb>[\\w_/-]+juno.dtb)'"
  prompt: "VExpress64# "
  delay: 0
  jitter: 0.0005

- cmd: wait
  for: "setenv bootargs 'console=ttyAMA0,115200n8 root=/dev/nfs nfsroot=(?P<server_ip>\\d+\\.\\d+\\.\\d+\\.\\d+):/var/lib/lava/dispatcher/tmp/(?P<nfs_tmpdir>\\d+/[\\w_-]+),tcp,hard,intr ip=dhcp"
  prompt: "VExpress64# "
  delay: 0
  jitter: 0.0005

- cmd: wait
  for: boot
  delay: 0
  jitter: 0.0005
  prompt: "VExpress64# "

